\\begin{equation*}
    \frac{dy}{dx} + P(x)y = Q(x),
\\end{equation*}
where $P(x) = 2$ and $Q(x) = e^{-x}$.

To solve this equation, we will use an integrating factor. The integrating factor is given by:
\\begin{equation*}
    \mu(x) = e^{\int P(x) \, dx} = e^{\int 2 \, dx} = e^{2x}.
\\end{equation*}

Multiplying both sides of the differential equation by the integrating factor, we get:
